Matéria exibida no dia 24/08/2020
EM MUITOS CASOS, PACIENTES ESTÃO COM SINTOMAS DE COVID, MAS ACREDITAM QUE PODE SER APENAS UMA GRIPE E ADIAM A PROCURA POR ATENDIMENTO MÉDICO. ISSO ACABA AGRAVANDO AINDA MAIS A DOENÇA. É O QUE PODE TER ACONTECIDO COM O CANTOR CAUAN, SEGUNDO O PARCEIRO DE DUPLA, O CLEBER, ELE ACHOU QUE PODERIA SER UMA GRIPE. VAMOS CONVERSAR AGORA COM O CARDIOLOGISTA FREDERICO COSTA NACRUTH QUE VAI FALAR SOBRE A IMPORTÂNCIA DE COMEÇAR O TRATAMENTO O MAIS RÁPIDO POSSÍVEL.
